import React from 'react';

//dependencies
import { Link } from "react-router-dom"
import { FaYoutube, FaTwitter, FaFacebookF, FaGithub, FaInstagram } from "react-icons/all"

//logo
import logo from "../images/logo.png"

//top-navigation bar
const TopNav = () => {
    return (
      <nav className="top-nav">
        <div className="top-nav-container">
          <div className="burger">
            <span></span>
          </div>
          <div className="logo">
            <Link to="/">
              <img src={logo} alt="bm-dev logo" />
            </Link>
          </div>
          <div className="social-media">
            <a href="http://www.youtube.com/">
              <FaYoutube className="icon" />
            </a>
            <a href="http://www.twitter.com/">
              <FaTwitter className="icon" />
            </a>
            <a href="http://www.facebook.com/">
              <FaFacebookF className="icon" />
            </a>
            <a href="http://www.github.com/">
              <FaGithub className="icon" />
            </a>
            <a href="http://www.instagram.com/">
              <FaInstagram className="icon" />
            </a>
          </div>
        </div>
      </nav>
    );
}

const MainNav = () => {
    return <nav>
        <div className="main-nav-conta">

        </div>
    </nav>
}

const Header = () => {
    return (
        <header className="header-container">
            <div className="top-nav"><TopNav/></div>
            <div className="main-nav"><MainNav/></div>
        </header>
    );
}

export default Header;
